content.css:
p {
  display: flex;
  font-size: 20px;
  font-weight: bold;
  align-content: center;
  justify-content: center;
  margin: 15px;
}
h1 {
  font-size: 4vw;
  display: flex;
  align-content: center;
  justify-content: center;
}
.parent {
  display: grid;
  grid-template-columns: 0.3fr repeat(7, 1fr);
  grid-template-rows: 0.5fr repeat(6, 1fr);
  grid-column-gap: 5px;
  grid-row-gap: 5px;
}
.divSemana {
  grid-area: 0.05555556;
}
.divWeek {
  grid-area: 0.125;
}
.divDia {
  grid-area: 0.01388889;
}
.div {
  display: grid;
  grid-template-columns: auto auto auto auto auto auto auto;
}
.div1 {
  display: grid;
  grid-template-columns: auto auto auto auto;
}
.div2 {
  display: grid;
  grid-template-columns: auto auto;
}
div.legenda {
  width: 96vw;
  height: 2%;
  display: grid;
  grid-template-columns: auto auto;
  justify-content: space-between;
  position: absolute;
  bottom: 25px;
  left: 16px;
  align-content: center;
}
p1.max {
  margin-right: 10px;
  margin-top: 40px;
}
p1.min {
  margin-left: 10px;
  margin-top: 40px;
}
.grid-container {
  display: grid;
  grid-template-columns: 0.3fr repeat(7, 1fr);
  grid-template-rows: auto auto auto auto auto auto;
  float: right;
}
div.semana {
  display: grid;
  grid-template-columns: 0.3fr repeat(7, 1fr);
}
p6 {
  text-align: center;
}
div.week {
  display: grid;
  grid-template-rows: auto auto auto auto auto auto;
}
p5 {
  text-align: center;
}
.box1 {
  display: flex;
  grid-column-start: 1;
  grid-column-end: 2;
  grid-row-start: 1;
  grid-row-end: 2;
  justify-content: center;
  align-items: center;
}
.box2 {
  display: flex;
  grid-column-start: 1;
  grid-column-end: 2;
  grid-row-start: 2;
  grid-row-end: 3;
  justify-content: center;
  align-items: center;
}
.box3 {
  display: flex;
  grid-column-start: 1;
  grid-column-end: 2;
  grid-row-start: 3;
  grid-row-end: 4;
  justify-content: center;
  align-items: center;
}
.box4 {
  display: flex;
  grid-column-start: 1;
  grid-column-end: 2;
  grid-row-start: 4;
  grid-row-end: 5;
  justify-content: center;
  align-items: center;
}
.box5 {
  display: flex;
  grid-column-start: 1;
  grid-column-end: 2;
  grid-row-start: 5;
  grid-row-end: 6;
  justify-content: center;
  align-items: center;
}
.box6 {
  display: flex;
  grid-column-start: 1;
  grid-column-end: 2;
  grid-row-start: 6;
  grid-row-end: 7;
  justify-content: center;
  align-items: center;
}
button {
  margin: 3px;
  min-width: 7vw;
  min-height: 7vh;
  cursor: pointer;
  border-radius: 1vmax;
  border: none;
}
div.pag {
  display: flex;
  flex-direction: column;
}
button.logo {
  margin: none;
  width: 200px;
  height: 63px;
  background-image: url(data:image/png;charset=utf-8;base64,);
  background-repeat: no-repeat;
  background-size: contain;
  background-position: center;
  bottom: 8px;
  right: 16px;
  position: absolute;
  border: none;
}
h3 {
  margin: 0px;
  font-size: 5vw;
}
h6 {
  margin: 5px;
  font-size: 5vw;
}
